import ReactDOM from 'react-dom';
import { Header } from './Header';
import { Balance } from './Balance';
import { IncomeExpenses } from './IncomeExpenses';


function App(){
    return (
        <div>
            <Header />
            <div className="container">
                <Balance />
                <IncomeExpenses />
            </div>
        </div>
    );
}

export default App;
